import { Layout, Page, TextStyle } from "@shopify/polaris";
const img = "https://cdn.shopify.com/s/files/1/0757/9955/files/empty-state.svg";
const Index = () => {
  return (
    <div>
      <Page>
        <Layout>
          <TextStyle variation="positive">
            Hello from React Express App
          </TextStyle>
        </Layout>
      </Page>
    </div>
  );
};

export default Index;
